import React from "react";
import Header from "../components/Header";
import Footer from "../components/Footer";

const Faq = () => {
  return (
    <div className="wrapper">
      <Header />
      <div className="main">Faq is here</div>
      <Footer />
    </div>
  );
};

export default Faq;
